import React from 'react'
import './Footer.css'

const Footer = () => {
    return (
        <div className="footer">
            <p>¡Bienvenido de vuelta! Queens es muy antigua con historia interesante. Queens, Nueva York es más antigua que la reina de Inglaterra. Además, Corona, Queens tiene muchos parques y restaurantes. Corona, Queens tiene el tren número siete (7) y cuatro autobuses (Q48, Q23, Q58, Q38). Mi actividad favorita en Corona, Queens es comer comida española con mis amigas. Yo quiero visitar una heladería que se llama Ben Faremo- The Lemon Ice King Of Corona, un restaurante Mexicano que se llama La Espiga y un restaurante Domincano que se llama llamado La Cabaña. Me gusta visitar los parques y restaurantes en Corona. Yo fui a la escuela en Corona, Queens. La construcción, las personas y culturales cambian con el paso del tiempo. Corona Queens es una comunidad de habla hispana ¿muy interesante e importante?. </p>
            <p>Build by Erica Chen for SPAN1102 Arte </p>

        </div>
    )
}
export default Footer
